import { StyleSheet, Text, View } from 'react-native'
import React from 'react'

const App = () => {
  return (
    <View>
      
        <View>
            <Text>Zalo Fake</Text>
        </View>

    </View>
  )
}

export default App

const styles = StyleSheet.create({})
